(1, 0, 1, 'home', 'Home', 'Home', '\n            <div class=\"container topmargin-lg bottommargin-lg\">\n                <div class=\"row\">\n                    <div class=\"col-md-5\">\n                        <img data-animate=\"fadeInLeftBig\" src=\"https://cms4.webfocusprod.wsiph2.com/cms4_philsagahs/public/theme/images/philsaga-high-school-logo.png\" style=\"height:350px;\" alt=\"Imac\" class=\"fadeInLeftBig animated\">\n                    </div>\n                    \n                    <div class=\"col-md-7 text-center\">\n                        <div class=\"heading-block\">\n                            <h2>Founding History</h2>\n                            <span>Philsaga High School Foundation Inc.</span>\n                        </div>\n\n                        <p style=\"text-align: justify;text-justify: inter-word;\">The school was established because of the request of barangay officials in Bayugan 3, who had seen the need of a school in the locality. For many years, the school made successful operations. It was one of the leading secondary schools of both Wasi-an and Bayugan 3 in Rosario, Agusan del Sur. In 2005, the management of the school was offered to Philsaga Mining Corporation, who owns the land where the school was located. The management immediately renovated the old and dilapidated school building and the equipment and facilities were improved. </p>\n\n                        <a href=\"#\" class=\"btn btn-outline-info btn-sm\">Learn More <i class=\"icon-line-arrow-right\"></i></a>\n                    </div>\n                </div>\n            </div>\n\n            <div class=\"section p-0\">\n                <div class=\"section parallax parallax-bg m-0 border-top-0 dark\" data-rellax-speed=\"2\" style=\"background: url(https://cms4.webfocusprod.wsiph2.com/cms4_philsagahs/public/theme/images/misc/bg.png) center center; padding: 100px 0;\" data-bottom-top=\"background-position:0px 0px;\" data-top-bottom=\"background-position:0px -200px;\">\n                    <div class=\"container-fluid center clearfix\">\n\n                        <div class=\"heading-block\">\n                            <h2>Our Teachers and Students Achievements</h2>\n                        </div>\n\n                        <div class=\"row justify-content-center col-mb-30\">\n                            <div class=\"col-sm-6 col-md-3 col-lg-1-4\" data-animate=\"bounceIn\">\n                                <div class=\"counter counter-large\"><span data-from=\"100\" data-to=\"1990\" data-refresh-interval=\"20\" data-speed=\"2000\"></span></div>\n                                <h5>Year Founded</h5>\n                            </div>\n\n                            <div class=\"col-sm-6 col-md-3 col-lg-1-4\" data-animate=\"bounceIn\" data-delay=\"200\">\n                                <div class=\"counter counter-large\"><span data-from=\"10\" data-to=\"198\" data-refresh-interval=\"10\" data-speed=\"2000\"></span></div>\n                                <h5>Certified Teachers</h5>\n                            </div>\n\n                            <div class=\"col-sm-6 col-md-3 col-lg-1-4\" data-animate=\"bounceIn\" data-delay=\"400\">\n                                <div class=\"counter counter-large\"><span data-from=\"520\" data-to=\"4173\" data-refresh-interval=\"10\" data-speed=\"10000\"></span></div>\n                                <h5>Graduated Students</h5>\n                            </div>\n\n                            <div class=\"col-sm-6 col-md-3 col-lg-1-4\" data-animate=\"bounceIn\" data-delay=\"600\">\n                                <div class=\"counter counter-large\"><span data-from=\"2\" data-to=\"96\" data-refresh-interval=\"3\" data-speed=\"500\"></span></div>\n                                <h5>Awards Won</h5>\n                            </div>\n                        </div>\n                    </div>\n                </div>\n            </div>\n\n            <div class=\"container topmargin-lg bottommargin-lg\">\n                <div class=\"heading-block center\">\n                    <h2>Latest <span>News</span></h2>\n                </div>\n                \n                <div id=\"posts\" class=\"post-grid row gutter-40 clearfix\" data-layout=\"fitRows\">\n                    {Featured Articles}\n                </div>\n                \n                <div class=\"text-center m-auto w-75\">                   \n                    <a href=\"#\" class=\"button button-border button-rounded ms-0 topmargin-sm button-small\">Read More</a>\n                </div>\n            </div>\n\n            <div class=\"section bg-warning m-0\">\n                <div class=\"container center\">\n                    <h2 class=\"mb-0 fw-light ls1\">Want to access all our articles? <a href=\"#\" data-scrollto=\"#template-contactform\" data-offset=\"140\" data-easing=\"easeInOutExpo\" data-speed=\"1250\" class=\"button button-border button-circle button-light button-large my-0\" style=\"position: relative; top: -3px;\">Click Here</a></h2>\n                </div>\n            </div>\n\n            {Calendar Activities}', NULL, NULL, 'PUBLISHED', 'default', '', 'Home', 'home', 'Home page', '1', 'home', '2023-05-04 02:57:58', '2023-05-04 06:22:07', NULL),
(2, 0, 0, 'about-us', 'About Us', 'About Us', '\n            <div class=\"heading-block\">\n                <h3>Founding History</h3>\n                <span>Philsaga High School Foundation Inc.</span>\n            </div>\n            \n            <img src=\"https://cms4.webfocusprod.wsiph2.com/cms4_philsagahs/public/theme/images/philsaga-high-school-logo.png\" alt=\"Imac\">\n            <p style=\"text-align: justify;text-justify: inter-word;\">The school was established because of the request of barangay officials in Bayugan 3, who had seen the need of a school in the locality. For many years, the school made successful operations. It was one of the leading secondary schools of both Wasi-an and Bayugan 3 in Rosario, Agusan del Sur. In 2005, the management of the school was offered to Philsaga Mining Corporation, who owns the land where the school was located. The management immediately renovated the old and dilapidated school building and the equipment and facilities were improved. </p>', NULL, NULL, 'PUBLISHED', 'standard', 'https://cms4.webfocusprod.wsiph2.com/cms4_philsagahs/public/theme/images/banners/image1.jpg', 'About Us', 'About Us', 'About Us page', '1', '', '2023-05-04 02:57:58', '2023-05-04 02:57:58', NULL),
(3, 0, 0, 'contact-us', 'Contact Us', 'Contact Us', '<section id=\"ig6t4\"><div id=\"io30j\" class=\"container\"><h3 id=\"iami\">Contact Details</h3><p id=\"id2io\"><strong>Our Office</strong><br/><br/><strong>Address:</strong><br/>\r\nPhilsaga High School Foundation Inc.<br/>\r\nBayugan 3, Rosario<br/>\r\nAgusan Del Sur<br/><br/><strong>Phone:</strong> (082) +63917 1234567<br/><strong>Fax:</strong> (082) 752 1433<br/><strong>Email:</strong> admin@phsfi.com</p><iframe frameborder=\"0\" src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d15791.537610856425!2d126.0051697!3d8.3142849!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x32fddfa9892c8d5b%3A0x4f6e6bc3086d355e!2sPhilsaga%20High%20School%20Foundation%2C%20Inc.!5e0!3m2!1sen!2sph!4v1683532189128!5m2!1sen!2sph\" width=\"600\" height=\"450\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\" id=\"icds3\"></iframe></div></section><div class=\"row topmargin d-none\"><div class=\"col-lg-6\"><address><abbr title=\"Address\">Address:</abbr><br/>\r\n                        444a EDSA, Guadalupe Viejo, Makati City, Philippines 1211\r\n                    </address></div><div class=\"col-lg-6\"><p><abbr title=\"Email Address\">Email:</abbr><br/>info@vanguard.edu.ph</p></div><div class=\"col-lg-6\"><p class=\"nomargin\"><abbr title=\"Phone Number\">Phone:</abbr><br/>(632) 8-1234-4567</p></div><div class=\"col-lg-6\"><p class=\"nomargin\"><abbr title=\"Phone Number\">Fax:</abbr><br/>(632) 8-1234-4567</p></div></div>', NULL, NULL, 'PUBLISHED', 'standard', '', 'Contact Us', 'Contact Us', 'Contact Us page', '1', 'contact-us', '2023-05-04 02:57:58', '2023-05-08 07:55:15', NULL),
